import ItemTicket from './itemTicket';
import Flavor from './flavor'

class ItemTicketRecipiente extends ItemTicket {
  flavors: Flavor[];
  
  constructor(id: number, title: string, price: number, pictureUrl: string, amount: number, flavors: Flavor[]) {
    super(id, title, price, pictureUrl, amount);
    this.flavors = flavors;
  }
}

export default ItemTicketRecipiente;
